import React from "react";
import Entry from "./Entry.jsx";
import emojipedia from "../emojipedia.js";


function EmojiCard(){
    return emojipedia.map(function(emojis){
        <Entry 
           icon = {emojis.emoji}
           name = {emojis.name}
           detail = {emojis.meaning}
        />  
    })
}


function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
        <EmojiCard />

    </div>
  );
}

export default App;
